'''5069 按字典序排在最后的子串'''


class Solution:
    def lastSubstring(self, s: str) -> str:

        indexlist = [0]
        head = ord(s[0])
        for i in range(1, len(s)):
            if head < ord(s[i]):
                indexlist = [i]
                head = ord(s[i])
            elif head == ord(s[i]):
                indexlist.append(i)
            else:
                continue

        def getchar(headinds):
            if headinds == []:
                return '', []

            if len(headinds)>1:
                tmpsum = (headinds[0]+headinds[-1])*len(headinds)//2
                if tmpsum == sum(range(len(headinds)+1))+(headinds[0]-1)*len(headinds):
                    return '', [headinds[0]]

            hi = headinds[0]+1
            tmplist = [hi]
            for i in headinds[1:]:
                # print('i:', i)
                if i == len(s)-1:
                    continue
                else:
                    if ord(s[hi])<ord(s[i+1]):
                        tmplist = [i+1]
                        hi = i+1
                    elif ord(s[hi]) == ord(s[i+1]):
                        tmplist.append(i+1)
                    else:
                        continue
            # print('sh:{}, tlist:{}'.format(s[hi], tmplist))
            return s[hi], tmplist

        res = chr(head)
        nhlist = indexlist
        # print('indexlist:', indexlist)
        # print('res:', res)
        while len(nhlist)>1:
            hchar, nhlist = getchar(nhlist)
            res = res+ hchar
        if len(nhlist) == 1:
            res = res + (s[nhlist[0]+1:] if nhlist[0]+1<len(s) else '')
        return res

if __name__ == '__main__':
    string = ""
    S = Solution()
    print(S.lastSubstring(string))
